import React from 'react'


const Navbar = () => {
  return (
    <StyledAppBar position="static">
        <Toolbar>
            <Tabs>All Users</Tabs>
            <Tabs>Add User</Tabs>
            <Tabs>Edit Users</Tabs>
            <Tabs>Logout</Tabs>
        </Toolbar>
    </StyledAppBar>
  )
}

export default Navbar;
